import React from 'react';
import TwoHandComposer from './components/TwoHandComposer';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sol-fa Hand Composer</h1>
        <p>Use both hands to compose music - Right hand for notes, Left hand for controls</p>
      </header>
      <main>
        <TwoHandComposer />
      </main>
    </div>
  );
}

export default App;
